(11, 11, 4, 'Fwd: National Bank Rate Update April 27 2010', '<br><div class="gmail_quote"><br>\r\n<div align="center">\r\n<br><font face="Comic Sans MS" size="5"><b>NATIONAL BANK BROKER SERVICES</b></font>\r\n<br>\r\n<br>\r\n<br><font color="red" face="Comic Sans MS" size="4"><b>Take Advantage Today!!!</b></font>\r\n<br>\r\n<br><font color="red" face="Comic Sans MS" size="4"><b>Up to 8% Cash Back Available\r\nOn Purchases, Refinances, And Switches</b></font>\r\n<br>\r\n<br><font color="red" face="Comic Sans MS" size="4"><b>With Rates Expected\r\nTo Rise Again Take Advantage Of Our 6 Month Rate Hold</b></font></div>\r\n<br>\r\n<div align="center">\r\n<br><font color="red" face="Comic Sans MS" size="5"><b>BEST RATES!!!</b></font>\r\n<br>\r\n<br>\r\n<br><font face="Comic Sans MS" size="4"><b>1 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>2.60%</b></font><font face="Comic Sans MS" size="4"><b><br>\r\n2 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>3.25%</b></font><font face="Comic Sans MS" size="4"><b><br>\r\n3 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>3.80%</b></font>\r\n<br><font face="Comic Sans MS" size="4"><b>4 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>4.29%</b></font>\r\n<br><font face="Comic Sans MS" size="4"><b>5 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>4.59%</b></font>\r\n<br><font face="Comic Sans MS" size="4"><b>6 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>4.94%</b></font>\r\n<br><font face="Comic Sans MS" size="4"><b>7 YEAR 60 DAY QUICK CLOSE IS </b></font><font color="red" face="Comic Sans MS" size="4"><b>5.20%</b></font>\r\n<br>\r\n<br><font face="Comic Sans MS" size="5"><b>VRM @ 1.85% (Prime-.40) </b></font>\r\n<br>\r\n<br><font face="Comic Sans MS" size="5"><b>All In One Credit Line P